const Experience = () => {
  return (
    <React.Fragment>
      <section id="experience" className="experience">
        <div className="container">
          <div className="row">
            <h2>Experience</h2>
            <div className="underline"></div>
          </div>
          <div className="row exp-content">
            <div className="col-lg-5 exp-info"></div>
            <div className="col-lg-5 exp-info"></div>
          </div>
        </div>
      </section>
    </React.Fragment>
  );
};
export default Experience;
